import PropTypes from 'prop-types'

function Header({text}) {
  return (
      <div className='container'>
        <h2>{true}</h2>
      </div>
  )
}

Header.defaultProps = {
  text: "Feedback UI",
}

Header.propTypes = {
  text: PropTypes.string,
}

export default Header
